  function buyETH(uint256 value) public {
    
    require(!paused);
    require(status!=-1,"Cancelled");
    require(value > 0);
    require(value>=costPresaleETH);

    if(maxUserAmount!=0)
    {
        uint256 tokbal=ILOToken.balanceOf(msg.sender);
        uint256 quota=(tokbal/10**decimals)*costPresaleETH;
        require(quota.add(value) <= maxUserAmount);
    }
    require(startPresaleTime<block.timestamp);
    require(endPresaleTime>block.timestamp);
    if(isWhitelistOn)
        require(isInList(uint256(msg.sender)));
    if(ILOToken.balanceOf(msg.sender)==0)
        users++;
    CurrencyETH.transferFrom(address(msg.sender),owner(),value);
    ILOToken.safeTransfer(address(msg.sender),  value.div(costPresaleETH) *10**decimals);
    sold=sold.add(value.div(costPresaleETH));
    uint256 priceRatio=costPresaleBNB.div(costPresaleETH);
    bnbCommitted[address(msg.sender)]=bnbCommitted[address(msg.sender)].add(priceRatio.mul(value));
    if(sold>=softcap)
      status=1;
    if(sold>=hardcap.div(costPresaleBNB))
    {
        status=2;
        paused=true;
    }
  }
    
